$(document).ready(function(){let filter=".filters [data-type]";let b=$(".b");$("body").on("click",filter,function(a){$(filter).removeClass("on");$(a.target).addClass("on");let type=$(a.target).data("type");if(type==="a"){b.show()}else{b.hide();$(".b."+type).show()}});$(".go,.so").on("click",function(){let s=$(this).parent().next(".l").find("pre").html();s=s.replace(/ /g,"+");$(this).hasClass("go")?window.open("https://google.com/search?q="+s,"_blank"):window.open("https://stackoverflow.com/search?q="+s,"_blank")});$("[type=search]").on("keyup search change",function(a){let sv=$(this).val();if(sv.length>3){$.each($(".events_log > .b"),function(d,c){if($(c).find(".l")!==undefined&&$(c).find(".l").html().indexOf(sv)>=0){$(c).show()}else{$(c).hide()}})}else{$(b).show()}})});